import React from "react";

let styles = {
  content: {
    marginTop: 500,
  },
};

const Tour = () => {
  return (
    <>
      <section>
        <div className="container">
          <div style={styles.content} className="content">
            <h1>Tour</h1>
          </div>
        </div>
      </section>
    </>
  );
};

export default Tour;
